import React, {Component} from 'react';
import SideBar from "../SideBar/SideBar";
import Header from "../Header/Header";
import Dialogs from "./Dialogs";


const DialogPage = () => {
    return (
        <div>
            <Header/>
            < div >
                    <SideBar/>
                    <Dialogs/>
            </div>
        </div>
    );
}

export default DialogPage
